import React from 'react'

const Navbar = ({ filterItem, catItem }) => {
    return (
        <>
            <div className="navbar">
                <div className="nav ">
                    {
                        catItem.map((curElems) => {
                            return <button className='btn btn-warning' onClick={() => filterItem(curElems)} > {curElems} </button>

                        })
                    }
                </div>
            </div>
        </>
    )
}

export default Navbar
